import axios from "axios";
import React from "react";

export default class RegisterPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      email: "",
      password: "",
      passwordConfirmation: "",
    };

    this.handleEmailChange = this.handleEmailChange.bind(this);
    this.handleNameChange = this.handleNameChange.bind(this);
    this.handlePasswordChange = this.handlePasswordChange.bind(this);
    this.handlePasswordConfirmationChange =
      this.handlePasswordConfirmationChange.bind(this);

    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleEmailChange(event) {
    this.setState({ email: event.target.value });
  }
  handlePasswordChange(event) {
    this.setState({ password: event.target.value });
  }
  handlePasswordConfirmationChange(event) {
    this.setState({ passwordConfirmation: event.target.value });
  }
  handleNameChange(event) {
    this.setState({ name: event.target.value });
  }

  async handleSubmit(event) {
    var x = await axios.get("http://guest.localhost/v1/restaurant/1");
    console.log(x.data);
    event.preventDefault();
  }

  render() {
    return (
      <main className="login">
        <div className="auth-container">
          <Logo />
          <form onSubmit={this.handleSubmit}>
            <h2>Sign in</h2>
            <p>
              You can <a href="/register">Register here!</a>
            </p>
            <div className="input-container">
              <img src={email.default} />
              <input
                placeholder="Email"
                type="email"
                value={this.state.email}
                onChange={this.handleEmailChange}
              />
            </div>

            <div className="input-container">
              <img src={password.default} />
              <input
                placeholder="Password"
                type="password"
                onChange={this.handlePasswordChange}
                value={this.state.password}
              />
            </div>

            <button className="primary-button">Login</button>
          </form>

          <form onSubmit={this.handleSubmit}>
            <input
              type="name"
              value={this.state.name}
              onChange={this.handleNameChange}
            />
            <input
              type="email"
              value={this.state.email}
              onChange={this.handleEmailChange}
            />
            <input
              type="password"
              onChange={this.handlePasswordChange}
              value={this.state.password}
            />
            <input
              type="password"
              onChange={this.handlePasswordConfirmationChange}
              value={this.state.passwordConfirmation}
            />
            <button>Submit</button>
          </form>
        </div>
        <div className="banner">
          <img src={image.default} />
          <h1>Sign in to DineEase</h1>
        </div>
      </main>
    );
  }
}
